Lo mejor, usar un comando DEFAULT en alguna de sus variantes:

#xcommand DEFAULT &lt;uVar1&gt; := &lt;uVal1&gt; ;
               [, &lt;uVarN&gt; := &lt;uValN&gt; ] =&gt; ;
                  &lt;uVar1&gt; := iif( &lt;uVar1&gt; == NIL, &lt;uVal1&gt;, &lt;uVar1&gt; ) ;;
                [ &lt;uVarN&gt; := iif( &lt;uVarN&gt; == NIL, &lt;uValN&gt;, &lt;uVarN&gt; ); ]

#xcommand DEFAULT &lt;v1&gt; TO &lt;x1&gt; [, &lt;vn&gt; TO &lt;xn&gt; ]                        ;
          =&gt;                                                            ;
          IF &lt;v1&gt; == NIL ; &lt;v1&gt; := &lt;x1&gt; ; END                           ;
          [; IF &lt;vn&gt; == NIL ; &lt;vn&gt; := &lt;xn&gt; ; END ]

#xtranslate BYDEFAULT &lt;V&gt;, &lt;Val&gt;     =&gt; iif( &lt;V&gt; == NIL, &lt;Val&gt;, &lt;V&gt; )

local a := { ;
                { 'GET', 'AAA' }, ;
                { 'GET', 'compras/customer' }, ;
                { 'GET', 'compras/customer' }, ;
                { 'GET', 'compras/customer/view' }, ;
                { 'GET', 'zzz' } ;
            }
   local bSort := {| x, y | lower( x[2] ) &gt; lower( y[2] ) }
   ASort( a,,, bSort )
   XBrowse( a )

Ordenacion *Ascendente:*
a:= aSort(a, nil, nil, {|x, y| x[2] &lt;= y[2] }

Ordenacion *Descendente:*
a:= aSort(a, nil, nil, {|x, y| x[2] &gt;   y[2] }
